import icon1 from '../../assets/images/weare_icon.png';
import icon2 from '../../assets/images/wedo_icon.png';
import icon3 from '../../assets/images/innovate_icon.png';
import backgroundImage1 from '../../assets/images/img_whowe.jpg'
import backgroundImage2 from '../../assets/images/img_whatwe.jpg'
import backgroundImage3 from '../../assets/images/img_weinnovate.jpg'


const BOXES_DATA = [
    {
        title: 'WHO WE ARE',
        icon: icon1,
        backgroundImage: backgroundImage1,
        text: 'Our expert team is constituted by sport psychologists, elite sport consultants and elite\n' +
            'sport managers. All of our team members are professionally qualified and certified on\n' +
            'Sport Psychology and Sport Management, we guarantee the highest standards of professional practice,' +
            ' including completing a combination of\n' +
            'educational and work requirements.',

    },
    {
        title: 'WHAT WE DO',
        icon: icon2,
        backgroundImage: backgroundImage2,
        text: 'We work with elite athletes and organisations to inspire the changes required to be the\n' +
            'best they can be.\n' +
            'We are collaborating with managers and staff members in addition to our research to\n' +
            'provide an innovative and efficient solution for our partnerships.',
    },
    {
        title: 'WE INNOVATE',
        icon: icon3,
        backgroundImage: backgroundImage3,
        text: 'Our solutions and our training strategies are powered by Artificial Intelligence and Virtual Reality tools.\n' +
            'Our expert team developed exclusive methods and strategies to help athletes reaching ambitious goals.\n' +
            'We can establish adapted solutions to the athlete and his/her needs.',
    },
];

export { BOXES_DATA };
